const ItemFooter = ({Icon, link, title}) => {
  return (
    <div>
      <a href={link} target="blank">
        <div>
          <Icon/>
          <h6>{title}</h6>
        </div>
      </a>
    </div>
  );
}

export {ItemFooter};
